import {useState} from 'react'

function Studentform(){

    const[id,setId]=useState("");
    const[rollNo,setRollNo]=useState(0);
    const[name,setName]=useState("");
    const[city,setCity]=useState("");
    const[dept,setDept]=useState("");

const saveId=(e)=>{
setId(e.target.value)
}
const saveRollNo=(e)=>{
    setRollNo(e.target.value)
}
const saveName=(e)=>{
    setName(e.target.value)
}
const saveCity=(e)=>{
    setCity(e.target.value)
}
const saveDept=(e)=>{
 setDept(e.target.value)
}

 const saveData=()=>{
    const data={id,rollNo,name,city,dept}
    fetch("http://localhost:3006/StudenInfo",{
        method:"POST",
        headers:{"Content-type": "application/json"},
        body:JSON.stringify(data)
    })
 }


    return(
        <div className="container">
            <div>
            <h1>Add Student data</h1>

            <form onSubmit={saveData}>
            <label>Id</label> 
            <br/>
            <input value={id} onChange={saveId} type="text" disabled="disable" /> 
            <br/>
            <label>Roll-No</label>
            <br/>
            <input value={rollNo} onChange={saveRollNo} type="number"/>
            <br/>
            <label>Name</label>
            <br/>
            <input value={name} onChange={saveName} type="text"/>
            <br/>
            <label>City</label>
            <br/>
            <input value={city} onChange={saveCity} type="text" />
            <br/>
            <label>Dept</label>
            <br/>
            <input  value={dept} onChange={saveDept} type="text"/>
            <br/><br/>
            <button type="submit" className="btn">Register</button>

            </form>
        </div>
        </div>
    )
}
export default Studentform;
